import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六癸日辛酉时断</p><p>六癸日生时辛酉，自身失地更何有；支中明暗被辛伤，无助利名终不就。</p><p>癸日辛酉时，明暗枭神。</p><p>癸见辛为倒食，酉上辛建旺，癸失地，若无倚托救助者，遇贵生涯；有倚托则吉。</p><p>癸丑日辛酉时，秋月，印绶格，行官煞运，吉。</p><p>冬，福禄双全。</p><p>子寅年月，干头无戊己字，贵。</p><p>癸卯日辛酉时，日贵格，辰戌丑未月，贵。</p><p>子卯年月，大贵。</p><p>巳午，亦贵。</p><p>又云不利妻子。</p><p>癸巳日辛酉时，孤。</p><p>寅卯年，辰戌丑未月，贵。</p><p>子午卯酉，中贵。</p><p>寅申巳亥，最贵。</p><p>癸未日辛酉时，春贫，夏先难后易，秋吉，冬贵。</p><p>癸酉日辛酉时，申酉月，印绶多，能守祖，破妻家。</p><p>子巳午月，干透庚辛，禄贵印绶俱全，贵不可言。</p><p>寅戌，腰金。</p><p>午亥，大贵。</p><p>丑月，煞重凶夭。</p><p>癸亥日辛酉时，戌月，行东南运，金紫；东北，风宪。</p><p>子月建禄，年遇财官，大贵。</p><p>天元是癸时申酉，用尽心机度日忙；官印相生逢印合，胸中便富且如常。</p><p>癸日辛酉时遇，倒食偏印难禁，柱中无依且安贫，财官月遇亦称。</p><p>只怕癸水失地，不能驱驾奚胜，六亲骨肉各西东，一生劳苦之命。</p>",26),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","284卷 九·六癸日辛酉时断.html.vue"]]);export{f as default};
